def get_indexer(
    self,
    target: AnyArrayLike,
    method: Optional[str] = None,
    limit: Optional[int] = None,
    tolerance: Optional[Any] = None,
) -> np.ndarray:

    self._check_method(method)

    if self.is_overlapping:  # Check if the IntervalIndex is overlapping
        msg = (
            "cannot handle overlapping indices; use "
            "IntervalIndex.get_indexer_non_unique"
        )
        raise InvalidIndexError(msg)

    target_as_index = ensure_index(target)

    if isinstance(target_as_index, IntervalIndex) and not is_object_dtype(target_as_index.dtype.subtype):
        # Non-overlapping and not object dtype
        left_indexer = self.left.get_indexer(target_as_index.left)
        right_indexer = self.right.get_indexer(target_as_index.right)
        indexer = np.where(left_indexer == right_indexer, left_indexer, -1)
    elif isinstance(target_as_index, CategoricalIndex) and isinstance(target_as_index.values, IntervalIndex):
        # Handling CategoricalIndex made from IntervalIndex
        return np.arange(len(target_as_index), dtype="intp")
    else:
        return np.repeat(np.intp(-1), len(target_as_index))

    return ensure_platform_int(indexer)
